Kikka/橘花是第三人称载具射击网游战争雷霆中，玩家可以驾驶的一架戰鬥機，是日本最早的{{黑幕|屌丝}}喷气机之一。　

{{黑幕|下一架就是佩刀了，加油！}}

== 戰機歷史 ==
橘花是日本在战争末期的开发产品，也是二战日本航空的巅峰产品{{黑幕|这真的不是黑}}，由中岛和海军空技厂联合设计。1944年，由于战局紧张和燃料缺乏，日本军方下令紧急开发新式飞机。1945年6月
中岛制造出了橘花的第一架原型机并在8月7日进行第一次试飞。在第二次试飞中，原型机因发动机故障而损毁，就这样以损坏状态迎来了战争的结束。{{黑幕|一共只完成了两架原型机}}
{{Hide|标题=橘花和Me-262”|内容=虽然橘花与德国的Me-262有颇多相似点，但两者在尺寸，翼型等方面还有相当大的区别，也并不是Me-262的仿制品。事实上，日方在设计过程中并没有得到德国提供的图纸，样机等援助，独立开发出了橘花。[[File:Me262_Kikka.jpg|200px]]}}

